import React from "react";
import './beer-page.css';
import Spinner from "../spinner";

const BeerPage = () => {
    return(
        <Row left={<Spinner/>} right={<Spinner/>}/>
    )
}
const Row = ({ left, right }) => {
    return(
        <div className='row mb2'>
            <div className='col-md-6'>
                {left}
            </div>
            <div className="col-md-6">
                {right}
            </div>
        </div>
    );
}

export default BeerPage;
